8.918238993711,\"height\":13.034825870647,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"font-size:1.25em\\\">If they fall on humid soil, the spores germinate into a small green blade called prothallus that attaches to the ground.</span></p>\\n\"},\"subContentId\":\"ae96b055-0192-4f3e-a4dc-dfea752662c9\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":38.868628181442,\"y\":27.951990049751,\"width\":60.930817610063,\"height\":56.069651741294,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"font-size:1.25em\\\">The prothallus is an autotrophic organism (capable of producing its own organic matter).<br />\\nOn the prothallus 2 types of organs will grow:</span></p>\\n\\n<p><span style=\\\"font-size:1.25em\\\">-The male organs that will produce male gametes (spermatozoids). Male gametes are mobile due to their flagella.</span></p>\\n\\n<p><span style=\\\"font-size:1.25em\\\">-The female organs that will give female gametes (oospheres or eggs) that are immobile.</span></p>\\n\"},\"subContentId\":\"9a337605-e961-4619-b5c4-6818265daa82\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"slideBackgroundSelector\":{\"fillSlideBackground\":\"#e8e6e7\"}},{\"slideBackgroundSelector\":{\"fillSlideBackground\":\"#e8e6e7\"},\"elements\":[{\"x\":3.2679738562092,\"y\":10.752688172043,\"width\":91.938997821351,\"height\":74.838709677419,\"action\":{\"library\":\"H5P.Image 1.1\",\"params\":{\"contentName\":\"Imag
